import React from 'react';
import { useState, useEffect } from 'react';

export default function Home() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3001/ads')
      .then(response => response.json())
      .then(json => setData(json));
  }, []);
  return (
    <div>Home</div>
  )
}
